import styled from "styled-components";

export const DetailContainer = styled.div`
  display: flex;
  flex-direction: row;
  justify-content: space-between;
  width: 85%;
  margin: auto;
  background-color: #e0ffcd;
  padding: 2em;
  border-radius: 28px;
  box-shadow: 10px 10px 188px 103px rgba(149, 255, 86, 0.91);
  font-weight: bold;
`;
